import {  } from "react-bootstrap";
const Table = (props) => {
  return (
    <>
      <CTable responsive="md">
        <CTableHead>
          <CTableRow>
            <CTableHeaderCell>Heading</CTableHeaderCell>
          </CTableRow>
        </CTableHead>
      </CTable>
    </>
  );
};
export default Table;
